import React,{Component} from 'react';
import './LeftPanelAdmin.css';
import ViewCompany from './ViewCompany';
import ViewJobs from './ViewJobs';
import StudentDetails from './StudentDetails';
import{ BrowserRouter as Router,
Route,
Link
}from 'react-router-dom';

class LeftPanelAdmin extends Component {
    constructor() {
        super();
        this.state={
            user: null
        }
    }

render() {
    return(
        <Router>
        <div>   
        {this.state.user}
        <div>
       <p><Link className="link" to="/ViewCompany">View Company</Link></p> 
       <p><Link className="link" to="/ViewJobs">View Jobs</Link></p>
       <p><Link className="link" to="/StudentDetails">Student Details</Link></p>

        </div>



    <Route path="ViewCompany" Component={ViewCompany} />
    <Route path="ViewJobs" Component={ViewJobs} />
    <Route path="StudentDetails" Component={StudentDetails} />

    </div>
    </Router>
    )
}


} 
export default LeftPanelAdmin;
